bor + nonagriculture_ratio + population + labor_force, data = train)\n","summary(lr)"]},{"cell_type":"markdown","id":"286a2fe7","metadata":{"papermill":{"duration":0.029057,"end_time":"2022-12-03T22:37:03.633589","exception":false,"start_time":"2022-12-03T22:37:03.604532","status":"completed"},"tags":[]},"source":["# Model Evaluation Metrics"]},{"cell_type":"markdown","id":"e4cbcc38","metadata":{"papermill":{"duration":0.02173,"end_time":"2022-12-03T22:37:03.676595","exception":false,"start_time":"2022-12-03T22:37:03.654865","status":"completed"},"tags":[]},"source":["The first step is to create a function for calculating the evaluation metrics R-squared and RMSE. The second step is to predict and evaluate the model on train data, while the third step is to predict and evaluate the model on test data."]},{"cell_type":"code","execution_count":19,"id":"610761c6","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:03.722978Z","iopub.status.busy":"2022-12-03T22:37:03.721437Z","iopub.status.idle":"2022-12-03T22:37:03.773825Z","shell.execute_reply":"2022-12-03T22:37:03.770718Z"},"papermill":{"duration":0.078374,"end_time":"2022-12-03T22:37:03.776567","exception":false,"start_time":"2022-12-03T22:37:03.698193","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"0.92\"\n","[1] \"799.17\"\n","[1] \"0.92\"\n","[1] \"681.73\"\n"]}],"source":["#Step 1 - create the evaluation metrics function\n","\n","eval_metrics = function(model, df, predictions, target){\n","    resids = df[,target] - predictions\n","    resids2 = resids**2\n","    N = length(predictions)\n","    r2 = as.character(round(summary(model)$r.squared, 2))\n","    adj_r2 = as.character(round(summary(model)$adj.r.squared, 2))\n","    print(adj_r2) #Adjusted R-squared\n","    print(as.character(round(sqrt(sum(resids2)/N), 2))) #RMSE\n","}\n","\n","# Step 2 - predicting and evaluating the model on train data\n","predictions = predict(lr, newdata = train)\n","eval_metrics(lr, train, predictions, target = 'unemployed')\n","\n","# Step 3 - predicting and evaluating the model on test data\n","predictions = predict(lr, newdata = test)\n","eval_metrics(lr, test, predictions, target = 'unemployed')"]},{"cell_type":"markdown","id":"e85e6d0b","metadata":{"papermill":{"duration":0.022693,"end_time":"2022-12-03T22:37:03.821745","exception":false,"start_time":"2022-12-03T22:37:03.799052","status":"completed"},"tags":[]},"source":["# Regularization\n","We will be using the **glmnet()** package to build the regularized regression models. The **glmnet** function does not work with dataframes, so we need to create a numeric matrix for the training features and a vector of target values.\n","\n","The lines of code below perform the task of creating model matrix using the **dummyVars** function from the caret package. The predict function is then applied to create numeric model matrices for training and test."]},{"cell_type":"code","execution_count":20,"id":"ec446a52","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:03.869776Z","iopub.status.busy":"2022-12-03T22:37:03.868084Z","iopub.status.idle":"2022-12-03T22:37:03.900789Z","shell.execute_reply":"2022-12-03T22:37:03.898118Z"},"papermill":{"duration":0.060072,"end_time":"2022-12-03T22:37:03.903392","exception":false,"start_time":"2022-12-03T22:37:03.84332","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] 49  4\n","[1] 22  4\n"]}],"source":["cols_reg = c('not_in_labor', 'nonagriculture_ratio', 'population', 'labor_force', 'unemployed')\n","\n","dummies <- dummyVars(unemployed ~ ., data = data[,cols_reg])\n","\n","train_dummies = predict(dummies, newdata = train[,cols_reg])\n","\n","test_dummies = predict(dummies, newdata = test[,cols_reg])\n","\n","print(dim(train_dummies)); print(dim(test_dummies))"]},{"cell_type":"markdown","id":"69e833f8","metadata":{"papermill":{"duration":0.021372,"end_time":"2022-12-03T22:37:03.946356","exception":false,"start_time":"2022-12-03T22:37:03.924984","status":"completed"},"tags":[]},"source":["# Ridge Regression"]},{"cell_type":"code","execution_count":21,"id":"a70ec3a7","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:03.992223Z","iopub.status.busy":"2022-12-03T22:37:03.99062Z","iopub.status.idle":"2022-12-03T22:37:04.155183Z","shell.execute_reply":"2022-12-03T22:37:04.153367Z"},"papermill":{"duration":0.190095,"end_time":"2022-12-03T22:37:04.157656","exception":false,"start_time":"2022-12-03T22:37:03.967561","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: Matrix\n","\n","\n","Attaching package: ‘Matrix’\n","\n","\n","The following objects are masked from ‘package:tidyr’:\n","\n","    expand, pack, unpack\n","\n","\n","Loaded glmnet 4.1-4\n","\n"]},{"data":{"text/plain":["          Length Class     Mode   \n","a0         51    -none-    numeric\n","beta      204    dgCMatrix S4     \n","df         51    -none-    numeric\n","dim         2    -none-    numeric\n","lambda     51    -none-    numeric\n","dev.ratio  51    -none-    numeric\n","nulldev     1    -none-    numeric\n","npasses     1    -none-    numeric\n","jerr        1    -none-    numeric\n","offset      1    -none-    logical\n","call        7    -none-    call   \n","nobs        1    -none-    numeric"]},"metadata":{},"output_type":"display_data"}],"source":["library(glmnet)\n","\n","x = as.matrix(train_dummies)\n","y_train = train$unemployed\n","\n","x_test = as.matrix(test_dummies)\n","y_test = test$unemployed\n","\n","lambdas <- 10^seq(2, -3, by = -.1)\n","ridge_reg = glmnet(x, y_train, nlambda = 25, alpha = 0, family = 'gaussian', lambda = lambdas)\n","\n","summary(ridge_reg)"]},{"cell_type":"markdown","id":"80db4e60","metadata":{"papermill":{"duration":0.023917,"end_time":"2022-12-03T22:37:04.204643","exception":false,"start_time":"2022-12-03T22:37:04.180726","status":"completed"},"tags":[]},"source":["**==>** One of the major differences between linear and regularized regression models is that the latter involves tuning a hyperparameter, lambda. The code above runs the glmnet() model several times for different values of lambda. We can automate this task of finding the optimal lambda value using the cv.glmnet() function. This is performed using the lines of code below."]},{"cell_type":"code","execution_count":22,"id":"dec7a673","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:04.296443Z","iopub.status.busy":"2022-12-03T22:37:04.294677Z","iopub.status.idle":"2022-12-03T22:37:04.450954Z","shell.execute_reply":"2022-12-03T22:37:04.448801Z"},"papermill":{"duration":0.300899,"end_time":"2022-12-03T22:37:04.527868","exception":false,"start_time":"2022-12-03T22:37:04.226969","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["0.501187233627272"],"text/latex":["0.501187233627272"],"text/markdown":["0.501187233627272"],"text/plain":["[1] 0.5011872"]},"metadata":{},"output_type":"display_data"}],"source":["cv_ridge <- cv.glmnet(x, y_train, alpha = 0, lambda = lambdas)\n","optimal_lambda <- cv_ridge$lambda.min\n","optimal_lambda"]},{"cell_type":"markdown","id":"b31ad900","metadata":{"papermill":{"duration":0.021643,"end_time":"2022-12-03T22:37:04.571691","exception":false,"start_time":"2022-12-03T22:37:04.550048","status":"completed"},"tags":[]},"source":["**==>** The optimal lambda value comes out to be **0.5011** and will be used to build the ridge regression model. We will also create a function for calculating and printing the results, which is done with the **eval_results()** function in the code below. \n","The next step is to use the predict function to generate predictions on the train and test data. Finally, we use the eval_results function to calculate and print the evaluation metrics."]},{"cell_type":"code","execution_count":23,"id":"27aa6774","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:04.620142Z","iopub.status.busy":"2022-12-03T22:37:04.617841Z","iopub.status.idle":"2022-12-03T22:37:04.676109Z","shell.execute_reply":"2022-12-03T22:37:04.674328Z"},"papermill":{"duration":0.085414,"end_time":"2022-12-03T22:37:04.678694","exception":false,"start_time":"2022-12-03T22:37:04.59328","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 1 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>RMSE</th><th scope=col>Rsquare</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>821.8109</td><td>0.9262225</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 1 × 2\n","\\begin{tabular}{ll}\n"," RMSE & Rsquare\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 821.8109 & 0.9262225\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 1 × 2\n","\n","| RMSE &lt;dbl&gt; | Rsquare &lt;dbl&gt; |\n","|---|---|\n","| 821.8109 | 0.9262225 |\n","\n"],"text/plain":["  RMSE     Rsquare  \n","1 821.8109 0.9262225"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 1 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>RMSE</th><th scope=col>Rsquare</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>687.2165</td><td>0.9339641</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 1 × 2\n","\\begin{tabular}{ll}\n"," RMSE & Rsquare\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 687.2165 & 0.9339641\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 1 × 2\n","\n","| RMSE &lt;dbl&gt; | Rsquare &lt;dbl&gt; |\n","|---|---|\n","| 687.2165 | 0.9339641 |\n","\n"],"text/plain":["  RMSE     Rsquare  \n","1 687.2165 0.9339641"]},"metadata":{},"output_type":"display_data"}],"source":["# Compute R^2 from true and predicted values\n","eval_results <- function(true, predicted, df) {\n","  SSE <- sum((predicted - true)^2)\n","  SST <- sum((true - mean(true))^2)\n","  R_square <- 1 - SSE / SST\n","  RMSE = sqrt(SSE/nrow(df))\n","\n","  \n","  # Model performance metrics\n","data.frame(\n","  RMSE = RMSE,\n","  Rsquare = R_square\n",")\n","  \n","}\n","\n","# Prediction and evaluation on train data\n","predictions_train <- predict(ridge_reg, s = optimal_lambda, newx = x)\n","eval_results(y_train, predictions_train, train)\n","\n","# Prediction and evaluation on test data\n","predictions_test <- predict(ridge_reg, s = optimal_lambda, newx = x_test)\n","eval_results(y_test, predictions_test, test)"]},{"cell_type":"markdown","id":"0b436894","metadata":{"papermill":{"duration":0.022671,"end_time":"2022-12-03T22:37:04.723402","exception":false,"start_time":"2022-12-03T22:37:04.700731","status":"completed"},"tags":[]},"source":["The above output shows that the RMSE and R-squared values for the ridge regression model on the training data are 821.8  and 0.92 percent, respectively. For the test data, the results for these metrics are 687.216  and 0.93 percent, respectively. There is an improvement in the performance compared with linear regression model."]},{"cell_type":"markdown","id":"64e77b55","metadata":{"papermill":{"duration":0.022494,"end_time":"2022-12-03T22:37:04.768105","exception":false,"start_time":"2022-12-03T22:37:04.745611","status":"completed"},"tags":[]},"source":["# Lasso Regression"]},{"cell_type":"markdown","id":"a50b77d7","metadata":{"papermill":{"duration":0.022503,"end_time":"2022-12-03T22:37:04.812489","exception":false,"start_time":"2022-12-03T22:37:04.789986","status":"completed"},"tags":[]},"source":["Lasso regression, or the Least Absolute Shrinkage and Selection Operator, is also a modification of linear regression. In lasso, the loss function is modified to minimize the complexity of the model by limiting the sum of the absolute values of the model coefficients (also called the l1-norm).\n","\n","The loss function for lasso regression can be expressed as below:\n","\n","Loss function = OLS + alpha * summation (absolute values of the magnitude of the coefficients)\n","\n","In the above function, alpha is the penalty parameter we need to select. Using an l1-norm constraint forces some weight values to zero to allow other coefficients to take non-zero values."]},{"cell_type":"markdown","id":"3b6f194b","metadata":{"papermill":{"duration":0.023179,"end_time":"2022-12-03T22:37:04.857901","exception":false,"start_time":"2022-12-03T22:37:04.834722","status":"completed"},"tags":[]},"source":["The first step to build a lasso model is to find the optimal lambda value using the code below. For lasso regression, the alpha value is 1. The output is the best cross-validated lambda, which comes out to be 1.25."]},{"cell_type":"code","execution_count":24,"id":"56faedbc","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:04.906691Z","iopub.status.busy":"2022-12-03T22:37:04.904986Z","iopub.status.idle":"2022-12-03T22:37:04.972677Z","shell.execute_reply":"2022-12-03T22:37:04.970792Z"},"papermill":{"duration":0.094895,"end_time":"2022-12-03T22:37:04.975042","exception":false,"start_time":"2022-12-03T22:37:04.880147","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["1.25892541179417"],"text/latex":["1.25892541179417"],"text/markdown":["1.25892541179417"],"text/plain":["[1] 1.258925"]},"metadata":{},"output_type":"display_data"}],"source":["lambdas <- 10^seq(2, -3, by = -.1)\n","\n","# Setting alpha = 1 implements lasso regression\n","lasso_reg <- cv.glmnet(x, y_train, alpha = 1, lambda = lambdas, standardize = TRUE, nfolds = 5)\n","\n","# Best \n","lambda_best <- lasso_reg$lambda.min \n","lambda_best"]},{"cell_type":"markdown","id":"dfd1f467","metadata":{"papermill":{"duration":0.023001,"end_time":"2022-12-03T22:37:05.020128","exception":false,"start_time":"2022-12-03T22:37:04.997127","status":"completed"},"tags":[]},"source":["Once we have the optimal lambda value, we train the lasso model in the first line of code below. The second through fifth lines of code generate the predictions and print the evaluation metrics for both the training and test datasets."]},{"cell_type":"code","execution_count":25,"id":"6d32dd1a","metadata":{"execution":{"iopub.execute_input":"2022-12-03T22:37:05.070762Z","iopub.status.busy":"2022-12-03T22:37:05.068998Z","iopub.status.idle":"2022-12-03T22:37:05.120351Z","shell.execute_reply":"2022-12-03T22:37:05.118347Z"},"papermill":{"duration":0.079137,"end_time":"2022-12-03T22:37:05.122683","exception":false,"start_time":"2022-12-03T22:37:05.043546","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 1 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>RMSE</th><th scope=col>Rsquare</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>816.4993</td><td>0.9271731</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 1 × 2\n","\\begin{tabular}{ll}\n"," RMSE & Rsquare\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 816.4993 & 0.9271731\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 1 × 2\n","\n","| RMSE &lt;dbl&gt; | Rsquare &lt;dbl&gt; |\n","|---|---|\n","| 816.4993 | 0.9271731 |\n","\n"],"text/plain":["  RMSE     Rsquare  \n","1 816.4993 0.9271731"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 1 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>RMSE</th><th scope=col>Rsquare</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>689.4933</td><td>0.9335258</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 1 × 2\n","\\begin{tabular}{ll}\n"," RMSE & Rsquare\\\\\n"," <dbl> & <dbl>\\\\\n","\\hline\n","\t 689.4933 & 0.9335258\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 1 × 2\n",